import LoginImg from "../asset/1.svg";
import "../style/Login.css";

const Login = () => {
  return (
    <div className="container">
      <div>
        <img src={LoginImg} alt="" />
      </div>
      <div>
        <form action="">
          <label>
            Email : <input type="email" className="email" />
          </label>
          <label>
            Password : <input type="password" />
          </label>
        </form>
      </div>
    </div>
  );
};

export default Login;
